import React from 'react';
import GoogleAuth from './GoogleAuth';
import './NavBar.css';

const Header = () => {
	return (
			<div className="ui secondary pointing menu">
				<h1>SlackOne</h1>
				<div className="right menu">
					<GoogleAuth />
				</div>
			</div>
	);
};

export default Header;
